import './ObjectDataPanel.css'

function ObjectDataPanel(props) {

    console.log(props.object)
    console.log(typeof(props.object))
    console.log(Object.keys(props.object))

    return (
        <div style={props.style_options? {...props.style_options} : null}>
            {Object.keys(props.object).map(function(key) {
                return (
                    <div>
                        {key}
                    </div>
                )
            })}
        </div>
    )
}

export default ObjectDataPanel
